class TsumamiFormation {
    constructor(id, hasHand) {
        this.bodyid = id + '_body';
        this.handid = id + '_hand';
        this.hasHand = hasHand;
        this.visible = false;
        this.visibleOpacity = 1;
    }
    toggle() {
        let op = this.visible ? 0 : this.visibleOpacity;
        document.getElementById(this.bodyid).style.opacity = op;
        if (this.hasHand) {
            document.getElementById(this.handid).style.opacity = op;
        }
        this.visible = !this.visible;
    }
}

let formations = [];

onload = function() {
    let formationNames = [
        'real', 'normal', 'ice', 'thinking_face', 'hamburger', 'noa', 'crying', 'invisible', 'angry', 'pien', 'robot', 'ghost', 'devil', 'bad'
    ];
    formationNames.forEach(
        e => formations.push(new TsumamiFormation(e, false))
    );
    formations[formationNames.indexOf('thinking_face')].hasHand = true;
    formations[formationNames.indexOf('crying')].hasHand = true;
    formations[formationNames.indexOf('normal')].visible = true;
    formations[formationNames.indexOf('ghost')].visibleOpacity = 0.3;
}

function getNextIconIndex() {
    let n = Math.floor(Math.random() * (100));
    if (window.matchMedia('(prefers-color-scheme: dark)').matches){
        return Math.ceil(n / 7.7);
    }else{
        return Math.ceil(n / 10);
    }
}

let nowform = 1;
function toggleIconMode() {
    do {
        var nextform = getNextIconIndex();
    }while(nowform === nextform);
    formations[nowform].toggle();
    formations[nextform].toggle();
    nowform = nextform;
}

